/**
 * Leetcode 152 - 乘积最大子数组
 *
 * @param {number []} nums
 * @return {number}
 */

var maxProduct = function(nums) {
    const size = nums.length
    let i = 0
    let max = nums[i] // assign first num as max num.
    let negativeNumIndexes = []

    while (i < size) {
        const numI = nums[i]
        let currentMax = numI
        let left = i
        let right = i + 1

        // console.log(`current max: ${currentMax}`)

        for (; right < size; right++) {
            const numJ = nums[right]
            if (!currentMax || !numJ) {
                break
            }

            let newCurrentMax = currentMax * numJ

            while (left > 0) {
                const subLeft = left - 1
                const numLeft = nums[subLeft]
                const nextNewCurrentMax = newCurrentMax * numLeft
                // If shifts to left, the multipled max should be bigger than not multipled.
                if (!numLeft || nextNewCurrentMax < currentMax || nextNewCurrentMax < newCurrentMax) {
                    break
                }
                newCurrentMax = nextNewCurrentMax
                left--
            }

            if (newCurrentMax < currentMax) {
                break
            }

            currentMax = newCurrentMax
        }

        // console.log([left, right, `current Max: ${currentMax}`])
        max = Math.max(max, currentMax)
        if (!left && right === size) {
            break
        }
        i++
    }

    return max
};

